import {Link} from 'react-router-dom';

function Header(){
    return (
        <div className='header'>
            <h1>#VANLIFE</h1>
            <div className='link'>
                <div>
                    <Link to='/'>Home</Link>
                </div>
                <div>
                    <Link to='/about'>About</Link>
                </div>
                
            </div>
        </div>
    )
}
export default Header
